import React from 'react';
const Search=props=>{
    let nameRef=createRef();
    /*const put=()=>{
        let name=nameRef.current.value;
        props.add(name);

    }*/
    const use=()=>{
        let name=nameRef.current.value;
        props.useEffect(name);
    }
    return(
        <div id="search">
            <input type="search" ref={nameRef}></input>
            <button onClick={use}>post</button>
            
            
        </div>
    )
}
export default Search;
